			var icon= '/wp-content/uploads/2023/01/tabou_decor_normal_resized.svg';

var latlng = new google.maps.LatLng( $marker.attr('data-lat'), $marker.attr('data-lng') )
		if ($marker.data('me') == 1) {
			pstart = $marker.attr('data-lat') + $marker.attr('data-lng');
			icon ='https://www.tabou.pl/wp-content/themes/tabou/images/pin_me.svg';
		}

		// create marker
		var marker = new google.maps.Marker({
			position  : latlng,
			map     : map,
			icon:icon,
			id: $marker.attr('data-lat')+$marker.attr('data-lng')
		});

		// add to array
		map.markers.push( marker );

		if( $marker.html() )
		{
			// create info window
			var infowindow = new SnazzyInfoWindow({
				marker: marker,
				placement: 'top',
				offset: {
					bottom: '0px'
				},
				content: '<span class="info-content">'+$marker.html()+'</span>',
				showCloseButton: true,
				closeOnMapClick: true,
				closeWhenOthersOpen: true,
				padding: '20px',
				backgroundColor: '#0D87AC',
				border: false,
				borderRadius: '0px',
				shadow: false,
				fontColor: '#fff',

	fontSize: '14px'
		});              
		infowindows.push(infowindow);
		// show info window when marker is clicked
		google.maps.event.addListener(marker, 'click', function() {
			for(var x in infowindows)
				infowindows[x].close();                    
			infowindow.open( map, marker );
		});
	}
	gmarkers.push(marker)
}

function center_map( map ) {
	// vars
	var bounds = new google.maps.LatLngBounds();

	// loop through all markers and create bounds
	jQuery.each( map.markers, function( i, marker ){
		var latlng = new google.maps.LatLng( marker.position.lat(), marker.position.lng() );
		bounds.extend( latlng );
	});
	var mapRadius = jQuery('#map_radius').val();
	var zoom = 6;
	if(mapRadius<=1){
		zoom = 6
	}
	else if(mapRadius<=5){
		if(first = true){
			zoom = 6
		}else{
			zoom = 12
		}          
	}
	else if(mapRadius<=30){
		zoom = 10;
	}
	else if(mapRadius<60){
		zoom = 9;
	}
	else if(mapRadius<=90){

zoom = 8;
		}
		else if(mapRadius<=120){
			zoom = 7;
		}
		else if(mapRadius<=160){
			zoom = 6;
		}
		else if(mapRadius<=190){
			zoom = 5;
		}
		first = false;
		// only 1 marker?
		if( map.markers.length == 1 )
		{
			// set center of map
			map.setCenter( bounds.getCenter() );
			map.setZoom( zoom );
		}
		else
		{
			// fit to bounds
			//map.fitBounds( bounds );
			map.setCenter( bounds.getCenter() );
			map.setZoom( zoom );
		}

	}

	function showRoute(el, event) {
		var $el = $(el), x, pointA, pointB;

		for (x in map.markers) {
			if (map.markers[x].id == pstart)
				pointA = map.markers[x];

			if (map.markers[x].id == $el.data('lat').toString()+$el.data('lng').toString())
				pointB = map.markers[x];
		}

		if(pP11 != null) {
			pP11.setMap(null);
			pP11 = null;
		}

		directionsService = new google.maps.DirectionsService;
		pP11 = new google.maps.DirectionsRenderer({
			map: map,
			suppressMarkers:true,
			polylineOptions: {

	strokeColor: "#E30513"
		}
	});

	directionsService.route({
		origin: pointA.position,
		destination: pointB.position,
		avoidTolls: true,
		avoidHighways: false,
		travelMode: google.maps.TravelMode.DRIVING
	}, function (response, status) {
		if (status == google.maps.DirectionsStatus.OK) {
			pP11.setDirections(response);
		} else {
			window.alert('Directions request failed due to ' + status);
		}
	});
}


